    }

  return (
    <>
        <Formik initialValues={{
            firstName:'',
            lastName:'',
            email:'',
            password: '',
            userImg: '',
        }}
        onSubmit={handleSubmit}
        >
      <Button variant="contained" endIcon={<SendIcon />}>
        Send
      </Button>
        </Formik>
    </>
  );
}

export default FormComponent;
